import * as React from 'react';
import { View, StyleSheet,ImageBackground} from 'react-native';
import { Button, ScrollView } from 'react-native-web';
import { Header,Container,HeaderButtonLeft,HeaderButtonRight} from './styles';
import { Entypo } from '@expo/vector-icons';
import { Ionicons } from '@expo/vector-icons';


function BluebarryPancakeScreen({navigation,route}) {
  const item = route.params;
  return (
    <View>
      <Container>
        <Header>
          <HeaderButtonLeft>
            <Ionicons name="chevron-back" size={20} color={"black"} onPress={navigation.goBack} />
          </HeaderButtonLeft>
          <HeaderButtonRight>
            <Entypo name="dots-two-horizontal" size={20} color="black" />
          </HeaderButtonRight>
        </Header>
        <ImageBackground source={require ('../BluebarryPancake/Vector.png')} 
        style={{position: 'absolute', width: 289,height: 288,left: 43,top: 122}}/>
        <ScrollView showsVerticalScrolIndicator={false}>
          <View style={{justifyContent:'center', alignItems:'center', height:280}}></View>
          <View style={style.details}></View>
          <View style={{flexDirection:'row', justifyContent:'space-between', alignItems:'center'}}></View>
          <Text style={{fontSize:25, fontWeight: 'bold', color: 'Black-color'}}></Text>
        </ScrollView>
        <Button
          title="Add to Breakfast Meal"
          onPress={() => navigation.navigate('Meal Schedule')}
        />
      </Container> 
    </View>
  );
};
const style = StyleSheet.create({
  details: {
    paddingHorizontal: 20,
    paddingTop: 40,
    paddingBottom: 60,
    backgroundColor: '#FFFFFF',
    borderTopRightRadius: 40,
    borderTopLeftRadius: 40
  }
});
export default BluebarryPancakeScreen;
